import React, { Component } from "react";
import {
  View,
  Text,
  TouchableOpacity,
  Image,
  Modal,
  StyleSheet,
  ScrollView,
} from "react-native";
import { FontAwesome5 } from "@expo/vector-icons";
// import { ScrollView } from "react-native-gesture-handler";

export default class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <View style={{ flex: 1 }}>
        <View>
          <TouchableOpacity
            onPress={() => {
              this.props.navigation.openDrawer();
            }}
            style={{ marginTop: 30, marginLeft: 20 }}
          >
            <FontAwesome5 name="bars" size={24} color="#000000"></FontAwesome5>
          </TouchableOpacity>
        </View>
        <Text style={{ fontWeight: "bold", fontSize: 32, color: "#0E6655" }}>
          DASHBOARD
        </Text>

        <ScrollView>
          <View style={styles.container}>
            {/* category card start------------------------------------------------------------------------------------------------------------------- */}

            <View
              style={{
                backgroundColor: "rgba(52, 52, 52, 0.0)",
                marginTop: 60,
                paddingVertical: 18,
                paddingHorizontal: 20,
                borderRadius: 23,
              }}
            >
              <TouchableOpacity
                onPress={() => {
                  this.props.navigation.navigate("AnimalViewDrawer");
                }}
              >
                <View
                  style={{
                    backgroundColor: "yellow",
                    paddingVertical: 30,
                    borderTopColor: "black",
                    paddingHorizontal: 30,
                    borderRadius: 23,
                    width: 340,
                    borderWidth: 1,
                    borderColor: "black",
                  }}
                >
                  <View style={{ flexDirection: "row" }}>
                    <View
                      style={{
                        flex: 10,
                        alignItems: "center",
                        justifyContent: "center",
                      }}
                    >
                      <Text
                        style={{
                          fontWeight: "bold",
                          fontSize: 26,
                          color: "#222222",
                        }}
                      >
                        My Animals
                      </Text>
                    </View>
                  </View>
                </View>
              </TouchableOpacity>
              <View
                style={{
                  position: "absolute",

                  alignItems: "center",

                  right: 10,
                  bottom: 80,
                }}
              >
                <Image
                  source={require("../../assets/animal.webp")}
                  style={{ height: 100, width: 100 }}
                />
              </View>
            </View>

            {/* category card------------------------------------------------------------------------------------------------------------------- */}
            {/* comment */}

            {/* category card start------------------------------------------------------------------------------------------------------------------- */}

            <View
              style={{
                backgroundColor: "rgba(52, 52, 52, 0.0)",
                marginTop: 30,
                paddingVertical: 18,
                paddingHorizontal: 20,
                borderRadius: 23,
              }}
            >
              <TouchableOpacity
                onPress={() => {
                  this.props.navigation.navigate("PadocksFieldViewDrawer");
                }}
              >
                <View
                  style={{
                    backgroundColor: "#2ECC71",
                    paddingVertical: 30,
                    borderTopColor: "black",
                    paddingHorizontal: 30,
                    borderRadius: 23,
                    width: 340,
                    borderWidth: 1,
                    borderColor: "black",
                  }}
                >
                  <View style={{ flexDirection: "row" }}>
                    <View
                      style={{
                        flex: 10,
                        alignItems: "center",
                        justifyContent: "center",
                      }}
                    >
                      <Text
                        style={{
                          fontWeight: "bold",
                          fontSize: 26,
                          color: "#222222",
                        }}
                      >
                        Land & Crop Manager
                      </Text>
                    </View>
                  </View>
                </View>
              </TouchableOpacity>
              <View
                style={{
                  position: "absolute",

                  alignItems: "center",

                  right: 10,
                  bottom: 80,
                }}
              >
                <Image
                  source={require("../../assets/animal.png")}
                  style={{ height: 100, width: 100 }}
                />
              </View>
            </View>

            {/* category card------------------------------------------------------------------------------------------------------------------- */}

            {/* category card start------------------------------------------------------------------------------------------------------------------- */}

            <View
              style={{
                backgroundColor: "rgba(52, 52, 52, 0.0)",
                marginTop: 30,
                paddingVertical: 18,
                paddingHorizontal: 20,
                borderRadius: 23,
              }}
            >
              <TouchableOpacity
                onPress={() => {
                  this.props.navigation.navigate("PurchasesDrawer");
                }}
              >
                <View
                  style={{
                    backgroundColor: "pink",
                    paddingVertical: 30,
                    borderTopColor: "black",
                    paddingHorizontal: 30,
                    borderRadius: 23,
                    width: 340,
                    borderWidth: 1,
                    borderColor: "black",
                  }}
                >
                  <View style={{ flexDirection: "row" }}>
                    <View
                      style={{
                        flex: 10,
                        alignItems: "center",
                        justifyContent: "center",
                      }}
                    >
                      <Text
                        style={{
                          fontWeight: "bold",
                          fontSize: 26,
                          color: "#222222",
                        }}
                      >
                        Purchases
                      </Text>
                    </View>
                  </View>
                </View>
              </TouchableOpacity>
              <View
                style={{
                  position: "absolute",

                  alignItems: "center",

                  right: 10,
                  bottom: 80,
                }}
              >
                <Image
                  source={require("../../assets/animal.webp")}
                  style={{ height: 100, width: 100 }}
                />
              </View>
            </View>

            {/* category card------------------------------------------------------------------------------------------------------------------- */}
          </View>
        </ScrollView>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  button: {
    backgroundColor: "white",
    height: 70,
    marginHorizontal: 20,
    borderRadius: 35,
    alignItems: "center",
    justifyContent: "center",
    marginVertical: 5,
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 7,
    },
    shadowOpacity: 0.41,
    shadowRadius: 9.11,

    elevation: 14,
  },
});
